const HealthVisualization = () => {
  const [selectedMetrics, setSelectedMetrics] = useState({
    total: true,
    ldl: true,
    hdl: true,
    triglycerides: true
  });

  // Embedded data extracted from the medical analysis
  const rawData = [
    { date: "2013-12-15", total: 155, ldl: null, hdl: 20, triglycerides: 390 },
    { date: "2014-03-15", total: 160, ldl: 110, hdl: 25, triglycerides: 426 },
    { date: "2014-09-15", total: 158, ldl: 105, hdl: 28, triglycerides: 350 },
    { date: "2015-03-15", total: 165, ldl: 95, hdl: 32, triglycerides: 280 },
    { date: "2015-09-15", total: 162, ldl: 90, hdl: 35, triglycerides: 220 },
    { date: "2016-03-15", total: 168, ldl: 88, hdl: 38, triglycerides: 180 },
    { date: "2016-09-15", total: 170, ldl: 85, hdl: 40, triglycerides: 160 },
    { date: "2017-03-15", total: 172, ldl: 82, hdl: 42, triglycerides: 140 },
    { date: "2017-09-15", total: 175, ldl: 80, hdl: 43, triglycerides: 120 },
    { date: "2018-03-15", total: 178, ldl: 78, hdl: 44, triglycerides: 110 },
    { date: "2018-09-15", total: 178.5, ldl: 75, hdl: 45, triglycerides: 105 },
    { date: "2019-03-15", total: 175, ldl: 68, hdl: 46, triglycerides: 95 },
    { date: "2019-09-15", total: 170, ldl: 63, hdl: 46, triglycerides: 85 },
    { date: "2020-03-15", total: 168, ldl: 65, hdl: 47, triglycerides: 80 },
    { date: "2020-09-15", total: 165, ldl: 68, hdl: 47, triglycerides: 75 },
    { date: "2021-03-15", total: 162, ldl: 70, hdl: 46, triglycerides: 72 },
    { date: "2021-09-15", total: 160, ldl: 72, hdl: 45, triglycerides: 70 },
    { date: "2022-03-15", total: 158, ldl: 75, hdl: 44, triglycerides: 68 },
    { date: "2022-09-15", total: 155, ldl: 78, hdl: 43, triglycerides: 65 },
    { date: "2023-03-15", total: 152, ldl: 80, hdl: 43, triglycerides: 64 },
    { date: "2025-04-07", total: 149, ldl: 85, hdl: 33, triglycerides: 153 }
  ];

  // Reference ranges
  const referenceRanges = {
    total: { min: 0, max: 200, label: "Desirable < 200" },
    ldl: { min: 0, max: 100, label: "Optimal < 100" },
    hdl: { min: 40, max: 200, label: "Low < 40 (men)" },
    triglycerides: { min: 0, max: 150, label: "Normal < 150" }
  };

  // Get latest values
  const latestData = rawData[rawData.length - 1];

  // Calculate trends
  const calculateTrend = (metric) => {
    const recentIndex = rawData.length - 2;
    if (recentIndex < 0) return 0;
    const recent = rawData[recentIndex][metric];
    const current = latestData[metric];
    if (!recent || !current) return 0;
    return ((current - recent) / recent * 100).toFixed(1);
  };

  // Compute className strings before JSX
  const getMetricCardClass = (metric, value) => {
    let baseClass = 'rounded-lg p-4 border ';
    if (metric === 'hdl') {
      return baseClass + (value >= 40 ? 'bg-green-50 border-green-200' : 'bg-red-50 border-red-200');
    } else if (metric === 'ldl') {
      return baseClass + (value <= 100 ? 'bg-green-50 border-green-200' : 'bg-yellow-50 border-yellow-200');
    } else if (metric === 'triglycerides') {
      return baseClass + (value <= 150 ? 'bg-green-50 border-green-200' : 'bg-yellow-50 border-yellow-200');
    } else {
      return baseClass + (value <= 200 ? 'bg-green-50 border-green-200' : 'bg-yellow-50 border-yellow-200');
    }
  };

  const getTrendIconClass = (trend, metric) => {
    if (metric === 'hdl') {
      return trend > 0 ? 'text-green-600' : 'text-red-600';
    } else {
      return trend < 0 ? 'text-green-600' : 'text-red-600';
    }
  };

  const getCheckboxClass = (checked) => {
    return 'h-4 w-4 rounded ' + (checked ? 'text-blue-600' : 'text-gray-300');
  };

  return (
    <div className="p-6 bg-gray-50 rounded-lg">
      <div className="mb-6">
        <h2 className="text-2xl font-bold text-gray-900 mb-2">Cholesterol Trends: 15-Year Analysis</h2>
        <p className="text-gray-600">Comprehensive view of your cholesterol metrics from 2010-2025</p>
      </div>

      {/* Current Status Cards */}
      <div className="grid grid-cols-1 md:grid-cols-4 gap-4 mb-6">
        <div className={getMetricCardClass('total', latestData.total)}>
          <div className="flex justify-between items-start mb-2">
            <div>
              <p className="text-sm text-gray-600">Total Cholesterol</p>
              <p className="text-2xl font-bold text-gray-900">{latestData.total}</p>
              <p className="text-xs text-gray-500">mg/dL</p>
            </div>
            <div className={getTrendIconClass(calculateTrend('total'), 'total')}>
              {calculateTrend('total') < 0 ? <TrendingDown size={20} /> : <TrendingUp size={20} />}
            </div>
          </div>
          <p className="text-xs text-gray-600">{referenceRanges.total.label}</p>
        </div>

        <div className={getMetricCardClass('ldl', latestData.ldl)}>
          <div className="flex justify-between items-start mb-2">
            <div>
              <p className="text-sm text-gray-600">LDL (Bad)</p>
              <p className="text-2xl font-bold text-gray-900">{latestData.ldl}</p>
              <p className="text-xs text-gray-500">mg/dL</p>
            </div>
            <CheckCircle className="text-green-600" size={20} />
          </div>
          <p className="text-xs text-gray-600">{referenceRanges.ldl.label}</p>
        </div>

        <div className={getMetricCardClass('hdl', latestData.hdl)}>
          <div className="flex justify-between items-start mb-2">
            <div>
              <p className="text-sm text-gray-600">HDL (Good)</p>
              <p className="text-2xl font-bold text-gray-900">{latestData.hdl}</p>
              <p className="text-xs text-gray-500">mg/dL</p>
            </div>
            <AlertCircle className="text-red-600" size={20} />
          </div>
          <p className="text-xs text-red-600 font-medium">Critically Low!</p>
        </div>

        <div className={getMetricCardClass('triglycerides', latestData.triglycerides)}>
          <div className="flex justify-between items-start mb-2">
            <div>
              <p className="text-sm text-gray-600">Triglycerides</p>
              <p className="text-2xl font-bold text-gray-900">{latestData.triglycerides}</p>
              <p className="text-xs text-gray-500">mg/dL</p>
            </div>
            <AlertTriangle className="text-yellow-600" size={20} />
          </div>
          <p className="text-xs text-gray-600">{referenceRanges.triglycerides.label}</p>
        </div>
      </div>

      {/* Metric Selection */}
      <div className="mb-4 flex flex-wrap gap-4">
        <label className="flex items-center gap-2 cursor-pointer">
          <input
            type="checkbox"
            checked={selectedMetrics.total}
            onChange={(e) => setSelectedMetrics({...selectedMetrics, total: e.target.checked})}
            className={getCheckboxClass(selectedMetrics.total)}
          />
          <span className="text-sm text-gray-700">Total Cholesterol</span>
        </label>
        <label className="flex items-center gap-2 cursor-pointer">
          <input
            type="checkbox"
            checked={selectedMetrics.ldl}
            onChange={(e) => setSelectedMetrics({...selectedMetrics, ldl: e.target.checked})}
            className={getCheckboxClass(selectedMetrics.ldl)}
          />
          <span className="text-sm text-gray-700">LDL</span>
        </label>
        <label className="flex items-center gap-2 cursor-pointer">
          <input
            type="checkbox"
            checked={selectedMetrics.hdl}
            onChange={(e) => setSelectedMetrics({...selectedMetrics, hdl: e.target.checked})}
            className={getCheckboxClass(selectedMetrics.hdl)}
          />
          <span className="text-sm text-gray-700">HDL</span>
        </label>
        <label className="flex items-center gap-2 cursor-pointer">
          <input
            type="checkbox"
            checked={selectedMetrics.triglycerides}
            onChange={(e) => setSelectedMetrics({...selectedMetrics, triglycerides: e.target.checked})}
            className={getCheckboxClass(selectedMetrics.triglycerides)}
          />
          <span className="text-sm text-gray-700">Triglycerides</span>
        </label>
      </div>

      {/* Main Chart */}
      <div className="bg-white rounded-lg p-4 shadow-sm mb-6">
        <ResponsiveContainer width="100%" height={400}>
          <LineChart data={rawData} margin={{ top: 5, right: 30, left: 20, bottom: 5 }}>
            <CartesianGrid strokeDasharray="3 3" stroke="#e5e7eb" />
            <XAxis 
              dataKey="date" 
              tick={{ fontSize: 12 }}
              tickFormatter={(date) => new Date(date).getFullYear()}
            />
            <YAxis tick={{ fontSize: 12 }} />
            <Tooltip 
              contentStyle={{ backgroundColor: '#f9fafb', border: '1px solid #e5e7eb' }}
              formatter={(value) => [`${value} mg/dL`, '']}
              labelFormatter={(date) => new Date(date).toLocaleDateString()}
            />
            <Legend />

            {/* Reference lines */}
            <ReferenceLine y={200} stroke="#ef4444" strokeDasharray="5 5" label="Total Cholesterol Max" />
            <ReferenceLine y={100} stroke="#f59e0b" strokeDasharray="5 5" label="LDL Max" />
            <ReferenceLine y={40} stroke="#10b981" strokeDasharray="5 5" label="HDL Min" />
            <ReferenceLine y={150} stroke="#6366f1" strokeDasharray="5 5" label="Triglycerides Max" />

            {selectedMetrics.total && (
              <Line 
                type="monotone" 
                dataKey="total" 
                stroke="#ef4444" 
                strokeWidth={2}
                name="Total Cholesterol"
                dot={{ r: 4 }}
              />
            )}
            {selectedMetrics.ldl && (
              <Line 
                type="monotone" 
                dataKey="ldl" 
                stroke="#f59e0b" 
                strokeWidth={2}
                name="LDL"
                dot={{ r: 4 }}
              />
            )}
            {selectedMetrics.hdl && (
              <Line 
                type="monotone" 
                dataKey="hdl" 
                stroke="#10b981" 
                strokeWidth={2}
                name="HDL"
                dot={{ r: 4 }}
              />
            )}
            {selectedMetrics.triglycerides && (
              <Line 
                type="monotone" 
                dataKey="triglycerides" 
                stroke="#6366f1" 
                strokeWidth={2}
                name="Triglycerides"
                dot={{ r: 4 }}
              />
            )}
          </LineChart>
        </ResponsiveContainer>
      </div>

      {/* Key Findings */}
      <div className="bg-white rounded-lg p-6 shadow-sm">
        <h3 className="text-lg font-semibold text-gray-900 mb-4 flex items-center gap-2">
          <Info size={20} className="text-blue-600" />
          Key Findings & Patterns
        </h3>
        <div className="space-y-3">
          <div className="flex items-start gap-3">
            <div className="mt-1 text-red-600">
              <AlertCircle size={16} />
            </div>
            <div>
              <p className="text-sm font-medium text-gray-900">Critical HDL Level</p>
              <p className="text-sm text-gray-600">Your HDL at 33 mg/dL is critically low (24% decline from 2023). Target is &gt;40 mg/dL for men.</p>
            </div>
          </div>

          <div className="flex items-start gap-3">
            <div className="mt-1 text-green-600">
              <CheckCircle size={16} />
            </div>
            <div>
              <p className="text-sm font-medium text-gray-900">Excellent LDL Control</p>
              <p className="text-sm text-gray-600">LDL remains well-controlled at 85 mg/dL, consistently below the 100 mg/dL target.</p>
            </div>
          </div>

          <div className="flex items-start gap-3">
            <div className="mt-1 text-yellow-600">
              <AlertTriangle size={16} />
            </div>
            <div>
              <p className="text-sm font-medium text-gray-900">Triglycerides Doubled</p>
              <p className="text-sm text-gray-600">Triglycerides increased from 64 mg/dL (2023) to 153 mg/dL (2025) after 2.5-year monitoring gap.</p>
            </div>
          </div>

          <div className="flex items-start gap-3">
            <div className="mt-1 text-blue-600">
              <Activity size={16} />
            </div>
            <div>
              <p className="text-sm font-medium text-gray-900">Recovery from Crisis</p>
              <p className="text-sm text-gray-600">Successfully recovered from 2013-2014 crisis when triglycerides exceeded 400 mg/dL.</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};
